import {Link} from 'react-router-dom';
import Header from './Include/Header';

function Main() {
  return (

    <div class="home">
        <Header />
        <div class="container">
            <div id="particles-js" class="particles"></div>
            <a href="index.php" class="home__logo">
                <img src='http://demo-designprojects.com/html/sigma-bank/images/logo.png' alt='image' class='imgFluid' loading='lazy' />
            </a>
            <div class="wrapper">
                <Link to="/SignUp">React</Link>
                <a onPress={() => Link('/SignUp')} class="themeBtn themeBtn--full">Seller </a>
                <a href="http://demo-designprojects.com/html/sigma-bank/buyer/sign-up.php" class="themeBtn themeBtn--full themeBtn--secondary">Buyer</a>
            </div>
            <a href="javascript:void(0)" data-toggle="modal" data-target="#fingerPrint" class="finger-print">
                <img src='http://demo-designprojects.com/html/sigma-bank/images/finger-print-img.png' alt='image' class='imgFluid finger-print__img' loading='lazy' />
                <div class="finger-print__title">Use fingerprint instead?</div>
            </a>
        </div>

    </div>
  );
}
export default Main;
